import './App.css';
import {Link, Route,Routes} from 'react-router-dom'
import {Login} from './pages/Login'
import {Home} from './pages/Home'
import {Signup} from './'
function App() {
  return (
    <>
    <Link to="/">Home</Link>
    <Link to="/login">Login</Link>
    <Link to="/Signup">Signup</Link>
    <Routes>
      <Route path="/login" element={Login}/>
    </Routes>
    </>
  );
}
export default App;
